import React, { Component } from 'react'
import {Button} from "reactstrap"

export default class ButtonHolder extends Component {

    state = {

    }

    render() {

        function BtnCreator() {
            let BtnArray = ["red", "blue", "green"].map((btn) => {
                return React.createElement(
                    Button,
                    {variant: 'primary'},
                    btn,
                  )
            })
            return BtnArray
        }

        return (
            <div>
                {BtnCreator}
            </div>
        )
    }
}
